"   <div class=\"ttl\">",
"    Lentigo maligna melanoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 380px; height: 396px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Lentigo maligna melanoma on the left cheek of a 68-year-old man with characteristic nodule signifying dermal invasion in the precursor surrounding in situ lesion (lentigo maligna).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
