var title_f40_29_41437="Rx uncomp malaria preg";
var content_f40_29_41437=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F52058&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F52058&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Treatment of uncomplicated malaria in pregnant women",
"    <sup>",
"     *&bull;&Delta;",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"40%\">",
"     </colgroup>",
"     <colgroup width=\"60%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Region infection acquired",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended drug and adult dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"5\">",
"        <p>",
"         <strong>",
"          Chloroquine-sensitive Plasmodium species",
"         </strong>",
"        </p>",
"        <p>",
"         Central America west of Panama Canal; Haiti; the Dominican Republic; and most of the Middle East.",
"        </p>",
"        <p>",
"         Infections acquired in the Newly Independent States of the former Soviet Union and Korea to date have been uniformly caused by",
"         <em>",
"          P. vivax",
"         </em>",
"         and should therefore be treated as chloroquine-sensitive infections.",
"        </p>",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Chloroquine (Aralen and generics)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        600 mg base (=1000 mg salt) po immediately, followed by 300 mg base (=500 mg salt) po at 6, 24, and 48 hours. Total dose: 1500 mg base (=2500 mg salt).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Hydroxychloroquine (Plaquenil and generics)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        620 mg base (=800 mg salt) po immediately, followed by 310 mg base (=400 mg salt) po at 6, 24, and 48 hours. Total dose: 1550 mg base (=2000 mg salt).",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"6\">",
"        <p>",
"         <strong>",
"          Chloroquine resistant",
"          <em>",
"           P. falciparum",
"          </em>",
"         </strong>",
"         *",
"        </p>",
"        <p>",
"         All malarious regions except those specified as chloroquine-sensitive listed in the box above.",
"        </p>",
"        <p>",
"         Middle Eastern countries with chloroquine-resistant",
"         <em>",
"          P. falciparum",
"         </em>",
"         include Iran, Oman, Saudi Arabia, and Yemen.",
"        </p>",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Quinine sulfate",
"        <strong>",
"         PLUS",
"        </strong>",
"        Clindamycin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Quinine sulfate: 542 mg base (=650 mg salt)",
"        <sup>",
"         &yen;",
"        </sup>",
"        po tid x 3 or 7 days",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Clindamycin: 20 mg base/kg/day (up to 1.8 grams) po divided tid x 7 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        <strong>",
"         OR",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Artemisinin combination therapy (during second and third trimesters)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Artemether + lumefantrine (or locally available artemisinin combination therapy). 1 tablet = 20 mg artemether and 120 mg lumefantrine. A 3-day treatment schedule with a total of 6 oral doses is recommended based on weight (25 to 35 kg: 3 tablets per dose, &ge;35 kg: 4 tablets per dose). The patient should receive the initial dose, followed by the second dose 8 hours later, then 1 dose po bid for the following 2 days.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        <p>",
"         <strong>",
"          Chloroquine-resistant",
"          <em>",
"           P. vivax",
"          </em>",
"         </strong>",
"        </p>",
"        <p>",
"         (See \"Overview of nonfalciparum malaria\" for regions with chloroquine-resistant",
"         <em>",
"          P. vivax",
"         </em>",
"         )",
"        </p>",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Quinine sulfate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Quinine sulfate: 650 mg salt po tid x 7 days",
"        <sup>",
"         &sect;",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     po: orally; bid: twice daily; tid: three times daily.",
"     <br/>",
"     * In general, there are four options available for treatment of uncomplicated malaria caused by chloroquine-resistant",
"     <em>",
"      P. falciparum",
"     </em>",
"     : atovaquone-proguanil, artemether-lumefantrine, quinine based regimens and mefloquine. Atovaquone-proguanil and artemether-lumefantrine are generally not recommended for use in pregnant women, particularly in the first trimester due to lack of sufficient safety data. For pregnant women diagnosed with uncomplicated malaria caused by chloroquine-resistant",
"     <em>",
"      P. falciparum",
"     </em>",
"     infection, atovaquone-proguanil or artemether-lumefantrine may be used if other treatment options are not available or are not tolerated, and if the potential benefit is judged to outweigh the potential risks. Because of a possible association between mefloquine treatment during pregnancy and an increase in stillbirths, mefloquine is generally not recommended for treatment in pregnant women. However, mefloquine may be used if it is the only treatment option available and if the potential benefit is judged to outweigh the potential risks. (Dosing is outlined in the Table: Guidelines for treatment of uncomplicated",
"     <em>",
"      P. falciparum",
"     </em>",
"     malaria).",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     For pregnant women diagnosed with uncomplicated malaria caused by chloroquine-resistant",
"     <em>",
"      P. falciparum",
"     </em>",
"     or chloroquine-resistant",
"     <em>",
"      P. vivax",
"     </em>",
"     infection, treatment with doxycycline or tetracycline is generally not indicated. However, doxycycline or tetracycline may be used in combination with quinine (as recommended for non-pregnant adults) if other treatment options are not available or are not tolerated, and the benefit is judged to outweigh the risks. (Dosing is outlined in the Table: Guidelines for treatment of uncomplicated",
"     <em>",
"      P. falciparum",
"     </em>",
"     malaria).",
"     <br/>",
"     &Delta; For",
"     <em>",
"      P. vivax",
"     </em>",
"     and",
"     <em>",
"      P. ovale",
"     </em>",
"     infections, primaquine phosphate for radical treatment of hypnozoites should not be given during pregnancy. Pregnant patients with",
"     <em>",
"      P. vivax",
"     </em>",
"     and",
"     <em>",
"      P. ovale",
"     </em>",
"     infections should be maintained on chloroquine prophylaxis for the duration of their pregnancy. The chemoprophylactic dose of chloroquine is 300 mg base (=500 mg salt) orally once per week. After delivery, pregnant patients who do not have G6PD deficiency should be treated with primaquine.",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     For infections acquired in Southeast Asia, quinine treatment should continue for 7 days. For infections acquired elsewhere, quinine treatment should continue for 3 days.",
"     <br/>",
"     &sect; US manufactured quinine sulfate capsule is only available in a 324 mg (salt) strength; therefore 2 capsules should be sufficient for adult dosing.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: United States Centers for Disease Control guidelines for treatment of malaria (",
"     <a href=\"file://www.cdc.gov/malaria/pdf/treatmenttable.pdf\">",
"      file://www.cdc.gov/malaria/pdf/treatmenttable.pdf",
"     </a>",
"     ). (Accesed June 27, 2010)",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
